import { Component } from '@angular/core';
import { UserService } from '../services/user.service';
import { User } from '../model/user';

@Component({
  selector: 'app-azuriraj-korisnika',
  templateUrl: './azuriraj-korisnika.component.html',
  styleUrls: ['./azuriraj-korisnika.component.css']
})
export class AzurirajKorisnikaComponent {

  constructor(private userService: UserService){
    
  }

  ngOnInit(): void{

    const storedUsername = localStorage.getItem('username');
  if (storedUsername) {
    this.userService.azurirajDohvati(storedUsername).subscribe(user => {
      this.user = user;
      this.ime = user.ime;
      this.prezime = user.prezime;
      this.pol = user.pol;
      this.adresa = user.adresa;
      this.kontakt_telefon = user.kontakt_telefon;
      this.email_adresa = user.email_adresa;
      this.profilna_slika = user.profilna_slika;
      this.broj_kreditne_kartice = user.broj_kreditne_kartice;
      this.username = user.username;
      this.password = user.password
      this.tip = user.tip;
    });
  }

  }

  ime: string;
  prezime: string;
  pol: string;
  adresa: string;
  kontakt_telefon: number;
  email_adresa: string;
  profilna_slika: string;
  broj_kreditne_kartice: number;
  username: string;
  password: string;
  tip: string;
  message: string;
  user: User = new User();
  cardIcon: string;
  isCardValid: boolean = false;
  errorMessage: string;
  imageError: string;

  private dinersPatterns = [/^300/, /^301/, /^302/, /^303/, /^36/, /^38/];
  private masterCardPatterns = [/^51/, /^52/, /^53/, /^54/, /^55/];
  private visaPatterns = [/^4539/, /^4556/, /^4916/, /^4532/, /^4929/, /^4485/, /^4716/];

  azuriraj(){

    this.userService.azuriraj(this.ime, this.prezime, this.pol, this.adresa, this.kontakt_telefon, 
      this.email_adresa, this.profilna_slika, this.broj_kreditne_kartice, this.username, this.password, this.tip).subscribe( resp=>{
        if(resp['message'] == "User not found"){
          this.message = "User not found"
        }

        else if(resp['message'] == "User updated successfully"){
          this.message = "User updated successfully"
        }

        else if(resp['message'] == "Password does not meet complexity requirements"){
          this.message = "Password does not meet complexity requirements"
        }
        
        else if(resp['message'] == "Error finding user"){
          this.message = "Error finding user"
        }
        else{
          this.message = "Error"
        }
      })

    

  }
  onFileChange(event: any) {
    this.imageError = '';
    if (event.target.files.length === 0) {
      return;
    }
    let reader = new FileReader();
    reader.onload = (e) => {
      if (!reader.result?.toString().includes('jpeg') && !reader.result?.toString().includes('png')) {
        this.imageError = 'Invalid image format.';

        return;
      }
      let image = new Image();
      image.onload = () => {
        if (image.width > 300 || image.height > 300 || image.width < 100 || image.height < 100) {
          this.imageError = `Invalid image dimensions.`;
          return;
        }
        this.profilna_slika = reader.result! as string;
      }
      image.src = reader.result! as string;
    }
    reader.readAsDataURL(event.target.files[0]);
  }
  validateCard(): void {
    const cardNumber = this.broj_kreditne_kartice?.toString();

    // Валидација за Diners картице
    if (this.dinersPatterns.some(pattern => pattern.test(cardNumber)) && cardNumber.length === 15) {
      this.cardIcon = 'data:image/png;base64,';  // Base64 Diners иконица
      this.isCardValid = true;
      this.errorMessage = '';  // Без грешке
    }
    // Валидација за MasterCard картице
    else if (this.masterCardPatterns.some(pattern => pattern.test(cardNumber)) && cardNumber.length === 16) {
      this.cardIcon = "data:image/png;base64,";  // Base64 MasterCard иконица
      this.isCardValid = true;
      this.errorMessage = '';  // Без грешке
    }
    // Валидација за Visa картице
    else if (this.visaPatterns.some(pattern => pattern.test(cardNumber)) && cardNumber.length === 16) {
      this.cardIcon = 'data:image/png;base64,';  // Base64 Visa иконица
      this.isCardValid = true;
      this.errorMessage = '';  // Без грешке
    }
    // Непознат тип картице или невалидан број
    else {
      this.cardIcon = null;
      this.isCardValid = false;  // Број картице није валидан
      this.errorMessage = 'Број кредитне картице није валидан. Молимо вас да унесете исправан број.';
    }
  }

}
